package org.jasmineliuliuliu.learning.basic;

public class MaxStringLengthTest {

  public static void main(String[] args) {

    //str1's length is limited to 65534 because of it's in String constants pool
    String str1 = ""
        + ""
        + ""
        + ""
        + ""
        + ""
        + ""
        + "";
    System.out.println("str1's length is: " + str1.length());

    // the maximum of array is limited to Integer.MAX_VALUE - 2 by javac
    char[] chars2 = new char[Integer.MAX_VALUE - 2];
    for (int i = 0; i < chars2.length; i++) {
      chars2[i] = (char) (i % 26 + 65);
    }
    String str2 = new String(chars2);
    System.out.println("str2's length is: " + str2.length());
    str2 = null;

    StringBuffer sb3 = new StringBuffer();
    // if i >= Integer.MAX_VALUE - 2, following exception is thrown:
    // Exception in thread "main" java.lang.OutOfMemoryError: Requested array size exceeds VM limit
    //	at java.base/java.util.Arrays.copyOf(Arrays.java:3536)
    //	at java.base/java.lang.AbstractStringBuilder.ensureCapacityInternal(AbstractStringBuilder.java:227)
    //	at java.base/java.lang.AbstractStringBuilder.append(AbstractStringBuilder.java:593)
    //	at java.base/java.lang.StringBuffer.append(StringBuffer.java:307)
    for (int i = 0; i < Integer.MAX_VALUE - 2; i++) {
      sb3.append("a");
    }
    String str3 = sb3.toString();
    System.out.println("str3's length is: " + str3.length());
    str3 = null;

    StringBuilder sb4 = new StringBuilder();
    // if i >= Integer.MAX_VALUE - 2, following exception is thrown:
    // Exception in thread "main" java.lang.OutOfMemoryError: Requested array size exceeds VM limit
    //	at java.base/java.util.Arrays.copyOf(Arrays.java:3536)
    //	at java.base/java.lang.AbstractStringBuilder.ensureCapacityInternal(AbstractStringBuilder.java:227)
    //	at java.base/java.lang.AbstractStringBuilder.append(AbstractStringBuilder.java:593)
    //	at java.base/java.lang.StringBuilder.append(StringBuilder.java:173)
    for (int i = 0; i < Integer.MAX_VALUE - 2; i++) {
      sb4.append("a");
    }
    String str4 = sb4.toString();
    System.out.println("str4's length is: " + str4.length());

    String str5 = str4 + "";
    System.out.println("str5's length is: " + str5.length());
  }

}
